import React from 'react';
import { Link } from 'react-router-dom';

function NotesPage() {
  return (
    <div>
      <h2>Página de Notas</h2>
      <p>¡Bienvenido a la página de Notas! Aquí podrás gestionar tus ideas y anotaciones.</p>
    </div>
  );
}

export default NotesPage;
